import React from 'react'
import { FaTwitter, FaLinkedinIn, FaGithub } from "react-icons/fa";

function Social () {
  return (
    <React.Fragment>
    <ul>
      <li><FaTwitter /></li>
      <li><FaLinkedinIn /></li>
      <li><FaGithub /></li>
    </ul>
    <style jsx>{`
      ul {
        margin-top: 35px;
        width: 100%;
        display: flex;
        justify-content: center;
        list-style: none;
      }

      ul > li {
        opacity: .5;
        transition: opacity 1s ease-in-out;
      }

      ul li:hover {
        opacity: .7;
      }
    `}</style>
    </React.Fragment>
  )
}

export default Social
